import React from 'react';
import 'element-theme-default';
import UserForm from './UserForm';
import UserTable from './UserTable';

class UserList extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <div>
                <UserForm />
                <UserTable />
            </div>
        )
    }
}
export default UserList;
